var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro pane test object.
 * @param {Object} [props] Initializes a UIAPro Pane test object using the supplied property bag.
 * @returns {Pane} the description object that was initialized.
 * @class Pane
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function Pane(props) {
    var paneDesc = new UiObjectBaseDescription("Pane");

    paneDesc._defineByPropertyBag(props);
    return paneDesc;
}

/**
 * A UIAPro pane.
 * @constructor
 * @class PaneTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function PaneTO(session, description) {
    description = description || Pane();
    var paneTO = new UiObjectBaseTO("UIAProPane", session, description);
    
    return paneTO;
}

module.exports.PaneTO = PaneTO;
module.exports.Pane = Pane;